Privacy laws afford residents of CA, CO, CT, NV, UT, and VA the right to opt out of the sale or sharing of personal information, defined in a way that may include the transfer and sharing of data to third parties to predict your preferences or interests to personalize ads for you on those third-party platforms. If you opt-out of Blizzard’s disclosure of your personal information for purposes that may be considered a “sale” or “sharing” by checking this option, we will not sell (should we do so in the future) or share your personal information collected in this game and for your Blizzard account, including to our marketing partners. 

